import App from './App';
import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';


function Routing() {
    return (
        <div className="App">
            <BrowserRouter>
                <Routes>
                    <Route path='/login' element={<App />} />
                </Routes>
            </BrowserRouter>

        </div>
    );
}

export default Routing;
